import {FaShoppingCart} from "react-icons/fa"
import { NavLink } from "react-router-dom";


const Navbar = () => {
  return (
    <div>
      <nav className="flex justify-between ">
       <NavLink to="/">
       <img src="../logo.png" alt="not found"/>
       </NavLink>
       
        <div>
          <NavLink to="/">
          <p>Home</p>
          </NavLink>
          <NavLink to="/cart">
          <div>
         <FaShoppingCart/>
         </div>
          </NavLink>
       
          
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
